	loading_bearger_yule = "Deafening roars fill the air with no hint of cessation,\nWho dares disturb Bearger's sweet hibernation?",
	loading_critters = "It was once thought that the beasts of the Constant were too wild and ferocious to be tamed. As it turns out, all any critter needs to make friends is a bit of love.",
	loading_deerclops_yule = "The night had seemed dead 'fore the sound broke the hush.\nThere! Something doth stir in the thick underbrush.\nTHUMP, THUMP, CLOMP, CLOMP, sound its footsteps together,\nThen you sight the clumped fur, the thin legs like black leather.\nIts eye trains on yours in a horrid red glow,\n...How swift might you flee through the knee-deep snow?",
	loading_dragonfly_yule = "Whilst lava burns hot in the cold winter night,\nThe Feastfly takes wing in a most fervid flight.",
	loading_goats_victorian = "\"Always hold the board steady. Remember, a sharp knife is safer than a dull one.\nDon't forget.\"",
	loading_goosemoose_yule = "A large plump goose sounds fit for a feast,\nUnless you're the meal for the terrible beast.",
	loading_magma = "Battlemaster Pugna draws great pleasure in subjecting combatants to the whims of his Battlearena forged of stone and fire.",
	loading_magma2 = "To escape the fiery Forge, our Survivors must triumph in battle against Battlemaster Pugna's fearsome champions.",
	loading_maxwell = "Maxwell's extended reign on the Nightmare Throne altered him in ways that are not yet fully understood. He continues to rely heavily on his tome, the Codex Umbra, as a result.",
	loading_merm = "Merms inhabited the marshes of The Constant long before humans, and will probably exist long after.",
	loading_pig_elite = "The Pig King's four elite warriors give half their winnings to those poor unfortunate pigs with no mud to roll in.",
	loading_pigking = "Legend has it the Pig King and his followers left their home long ago to rule freely in The Constant.",
	loading_webber = "Webber could have easily seen his unique predicament as an affliction or a curse. Instead, he's chosen to view it as a second chance, and one that he fully intends not to waste.",
	loading_webber_feast = "\"We're super excited to watch everyone open the presents we got them.\"",
	loading_wendy = "Wendy clings fiercely to the grief over her sister's death, for fear that moving on would cause Abigail's memory to fade.",
	loading_wendy_creepy = "She can't escape her monomaniacal obsession with death.\nNeither can you.",
	loading_wendy_victorian = "Wendy finds a strange comfort in elaborate mourning rituals.\nIt takes the guesswork out of grieving.",
	loading_wes_victorian = "There are few more satisfying feelings in life than knowing one's work is done for the day.",
	loading_wickerbottom = "Delightfully, Ms. Wickerbottom has found her passion for the written word has only deepened as the years go by. Any knowledge committed to paper becomes impervious to the brain fogs of age, you know!",
	loading_wickerbottom_victorian = "It's a well-known fact that a group of crows is called a \"murder\".\nIt is a lesser known fact that they hold crow funerals.",
	loading_wigfrid = "The valor and confidence of a Valkyrie didn't always come naturally to Wigfrid. She cultivated her strength and persona over many years through sheer force of will.",
	loading_willow_bats = "Woeful Willow took an axe.\nGave a tree forty whacks.",
	loading_willow_victorian = "Sometimes in the cold and bitter night, one might imagine fantastical visions in the blaze of a lit match.",
	loading_willowfire = "Willow always regarded being brought to The Constant as a new beginning. It allowed her to leave everything behind, after all.",
	loading_wilson_feast = "\"Science says I'll be nipping at your nose.\"",
	loading_wilson_madscience = "Knowledge can consume the mind to feed the soul.\nAnd consume the soul to feed the mind.",
	loading_winona_victorian = "The clank of hammers is music to the blacksmith's ears.\nThe smell of coal, a sweet perfume.",
	loading_wolfgang = "Whether in troupes or troops, Wolfgang has always thrived on the spirit of camaraderie. He considers the day he joined the survivors to be the moment his luck finally took a turn for the better.",
	loading_wolfgang_feast = "\"A mighty Winter's Feast makes Wolfgang even mightier!\"",
	loading_woodie_victorian = "After many days in the woods, it can be difficult to distinguish oneself from that which they hunt.",
	loading_wx_magma = "WX-78 has a burning need to\nINCINERATE.",
